import React from 'react';
import PropTypes from 'prop-types';

function Food(props:any) {
    return (
        <div>
            <h2>I like {props.name}</h2>
            <img src={props.image} alt={props.name} />
        </div>
    );
}

const foodIlike: {id: number, name: string, image: string, rating: number}[] = [
    {
        id : 1,
        name: "kimchi",
        image: "data:image/jpeg;base64,",
        rating: 1.2
    },
    {
        id : 2,
        name: "깍두기",
        image: "data:image/jpeg;base64,",
        rating: 4.6
    }
];

function App() {
  return (
    <div className="App">
      <h1>Hello!</h1>
        {foodIlike.map(dish => <Food key={dish.id} name={dish.name} image={dish.image}></Food>)}
    </div>
  );
}

export default App;
